import React from "react";
import "./InputBox.css";

const InputBox = () => {
  return (
    <div className="inputbox">
      <div className="inputpad">
        <div className="inputrow"></div>
        <div className="numrow"></div>
        <div className="numrow"></div>
        <div className="numrow"></div>
      </div>
      <div></div>
    </div>
  );
};

export default InputBox;
